import React from "react";
import { Outlet } from "react-router-dom";
import { Header, Navigation } from "../../components";

const Public = () => {
  return (
    <div className="bg-gray-50">
      <Header />
      <Navigation />

      <div className="w-full">
        <Outlet />
      </div>
    </div>
  );
};

export default Public;
